@prefix sh: <http://www.w3.org/ns/shacl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

[] a sh:ValidationReport ;
    sh:conforms false ;
    sh:result [ a sh:ValidationResult ;
            sh:focusNode <https://example.org/exampleWebAPI_354btrh> ;
            sh:resultMessage "a link or URL to a machine-actionable service distribution object should be provided if it exists" ;
            sh:resultPath schema1:documentation ;
            sh:resultSeverity sh:Info ;
            sh:sourceConstraintComponent sh:OrConstraintComponent ;
            sh:sourceShape [ sh:message "a link or URL to a machine-actionable service distribution object should be provided if it exists" ;
                    sh:minCount 1 ;
                    sh:or ( [ sh:nodeKind sh:IRI ] [ sh:datatype xsd:string ] ) ;
                    sh:path schema1:documentation ;
                    sh:severity sh:Info ] ;
            sh:value [ a schema1:CreativeWork ;
                    schema1:description "XxEWiBXJhROXXws" ;
                    schema1:name "OgsRNbhr" ;
                    schema1:url "http://example.com/resource?foo=bar#fragment" ] ],
        [ a sh:ValidationResult ;
            sh:focusNode <https://example.org/exampleWebAPI_354btrh> ;
            sh:resultMessage "A WebAPI node must specify a service type with a string or IRI. string must have length >=3" ;
            sh:resultPath schema1:serviceType ;
            sh:resultSeverity sh:Violation ;
            sh:sourceConstraintComponent sh:OrConstraintComponent ;
            sh:sourceShape [ sh:message "A WebAPI node must specify a service type with a string or IRI. string must have length >=3" ;
                    sh:minCount 1 ;
                    sh:or ( [ sh:nodeKind sh:IRI ] [ sh:datatype xsd:string ;
                                sh:minLength 3 ] ) ;
                    sh:path schema1:serviceType ] ;
            sh:value "" ],
        [ a sh:ValidationResult ;
            sh:focusNode <https://example.org/exampleWebAPI_354btrh> ;
            sh:resultMessage "at least one action must be provided for a webAPI distribution" ;
            sh:resultPath schema1:potentialAction ;
            sh:resultSeverity sh:Violation ;
            sh:sourceConstraintComponent sh:ClassConstraintComponent ;
            sh:sourceShape [ sh:class schema1:SearchAction ;
                    sh:message "at least one action must be provided for a webAPI distribution" ;
                    sh:minCount 1 ;
                    sh:path schema1:potentialAction ] ;
            sh:value <https://example.org/exampleAction_37467> ] .

